local imgaes ={
    ["close.png"] = "",
    ["info.png"] = "",
    ["light.png"] = "",
    ["ref.png"] = "",
    ["settings.png"] = "",
}

if not file.Exists("mpdonate", "DATA") then
    file.CreateDir("mpdonate")
end
for k,v in pairs(imgaes) do
    if not file.Exists("mpdonate/"..k, "DATA") then
        file.Write("mpdonate/"..k, util.Base64Decode(v))
    end
end